import React from 'react';


const Network = () => {
    return (
        <div className="mb-3">
            <div className="input-group mb-3">
                <input type="text" className="form-control" placeholder="이름으로 검색" aria-label="Recipient's username" aria-describedby="button-addon2" />
                <button className="btn btn-outline-secondary" type="button" id="button-addon2">검색</button>
            </div>
        </div>
    );
    
}

export default Network;
